import React from 'react';

function VideoPreviewComponent({ videoURL, processedFramePath }) {
  return (
    <div className="video-preview-component">
      <h2>Preview</h2>
      {videoURL && (
        <div>
          <video controls>
            <source src={videoURL} type="video/mp4" />
            Your browser does not support the video tag.
          </video>
          <img
            src={`http://localhost:5000/${processedFramePath}`}
            alt="Processed Frame"
          />
        </div>
      )}
    </div>
  );
}

export default VideoPreviewComponent;
